import axios from "axios";
import { useEffect } from "react";

const CategoryList = () => {
  const Category = async () =>
    await axios
      .post("http://127.0.0.1:8000/webKiosk/client/category/read/", {
        market_name: "S",
      })
      .then((response) => {
        console.log(response.data);
      });
  useEffect(() => {
    Category();
  }, []);

  return;
};

export default CategoryList;
